import Connection from "../function/Connection";

const photoUrl = "https://jsonplaceholder.typicode.com/photos";

const getPhoto = () => (dispatch) => {
  return Connection.getPhoto(photoUrl)
    .then((resp) => {
      dispatch({
        type: "SET_PHOTO",
        payload: resp.data,
      });
    })
    .catch((err) => {
      dispatch({
        type: "SET_ERROR_MESSAGE",
        message: "error.unable_to_process",
      });
    });
};

export { getPhoto };
